import React, {Component} from 'react'
import './styles.css'
export class Basic extends Component{
    render(){
        return(
            <div className="topbox">
                <h2>
                Welcome
                <hr></hr>
                Doc ID:
                </h2>
            </div>
        )
    }
}
export class Alerts extends Component{
    render(){
        return(
        <div className="alerts">
            <h2>Alerts</h2>
        </div>
        )
    }
}
